import React from "react";
import { useNavigate } from "react-router-dom";
import { Menu } from "antd";
import "./Header.css";

const Header = () => {
  const navigate = useNavigate();
  const handleHomeClick = () => {
    navigate("/");
  };

  const handleMarketClick = () => {
    navigate("/market");
  };

  return (
    <div className="menu-container">
      <div className="menu-left">
        <img src="/path/to/logo.png" alt="Logo" style={{ height: "100%" }} />
      </div>
      <div className="menu-center">
        <Menu
          theme="dark"
          mode="horizontal"
          selectable={false}
          style={{ lineHeight: "120px", height: "120px" }}
        >
          <Menu.Item key="home" style={{ fontSize: "20px" }}>
            Home
          </Menu.Item>
          <Menu.Item key="myteam" style={{ fontSize: "20px" }}>
            My Team
          </Menu.Item>
        </Menu>
      </div>
      <div className="menu-right">
        <Menu
          theme="dark"
          mode="horizontal"
          selectable={false}
          style={{ lineHeight: "120px", height: "120px" }}
        >
          <Menu.Item key="signin" style={{ fontSize: "20px" }}>
            Sign In
          </Menu.Item>
        </Menu>
      </div>
    </div>
  );
};

export default Header;
